import "./Header.css";
import logo from "../img/logo.png";
import Underline from "./Underline";

function Header() {
  const hoverHandler = (e) => {
    console.log(e);
  };

  return (
    <div className="Header">
      <div className="logo_div">
        <a href="index.html">
          <img className="logo_img" src={logo}></img>
        </a>
      </div>
      <ul>
        <li>
          <a href="index.html" onMouseEnter={hoverHandler}>
            회사소개
          </a>
        </li>
        <li>
          <a href="index.html">프로그램</a>
        </li>
        <li>
          <a href="index.html">레슨문의</a>
        </li>
        <li>
          <a href="index.html">지사개설</a>
        </li>
        <li>
          <a href="index.html">교사지원</a>
        </li>
        <li>
          <a href="index.html">커뮤니티</a>
        </li>
      </ul>
      <Underline></Underline>
    </div>
  );
}

export default Header;
